import React, { Component } from 'react';

import './banner';
import Banner from 'react-banner';
import Headroom from 'react-headroom';
class Home extends Component {
  render() {
    return (
      <div>
        <Headroom/>
        <Banner/>
      </div>
    );
  }
}

export default Home;
